import React from 'react';
import Header1 from './Components/Header';
import Main1 from './Components/body';
import Footer from './Components/footer';
import ImpExp from './Components/ImpExp';
import {rohan,shyam} from './Components/ImpExp';



let App=()=>{
    return(
        <>
        <Header1/>
        <Main1/>
        <Footer/>
        <ImpExp/>
        <h1>{rohan}</h1>
        <h1>{shyam}</h1>

        </>
    );
};

export default App;
